import React, { Component } from "react";

class PorfolioProject extends Component {
  render(props) {
    console.log(props);

    return (
      <div>
        {props.myPortolioUn.map(myFolio => (
          <h1> {myFolio.id}</h1>
        ))}
      </div>
    );
  }
}

export default PorfolioProject;
